
bool titleValid = false, headingValid = false, iconValid = false;

void *antiLeech(void *) {
    sleep(15);
    if (!titleValid || !headingValid || !iconValid) {
        //Bad function to make it crash
        int *p = 0;
        *p = 0;
    }
    return NULL;
}

